import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import ViewDragonBall from "../views/ViewDragonBall";

function Navbar({ children }) {
  return (
    <div>
      <nav className="navbar navbar-expand navbar-light bg-dark">
        <Router>
          <ul className="nav navbar-nav">
            <li className="nav-item " key="{">
              <Link to="/naruto" className="nav-link text-light">
                Naruto Shippuden
              </Link>
            </li>
            <li className="nav-item">
              <Link to="/dragonball" className="nav-link text-light">
                {" "}
                Dragon Ball Super{" "}
              </Link>
            </li>
          </ul>
          <Route path="/Naruto"></Route>
          <Route path="/dragonball" component={ViewDragonBall}></Route>
        </Router>
      </nav>
      {children}
    </div>
  );
}

export default Navbar;
